svg.script:


function onMouseOverLabel(evt) { 
    var Line = document.getElementById(evt.target.id.replace("Label", "Line")); 
    Line.setAttribute("style", "fill:none;stroke:black;stroke-width:3"); 
    evt.target.setAttribute("font-size", 17); 
} 
function onMouseOutLabel(evt) { 
    var Line = document.getElementById(evt.target.id.replace("Label", "Line")); 
    Line.setAttribute("style", "fill:none;stroke:black;stroke-width:1"); 
    evt.target.setAttribute("font-size", 15); 
} 
function onMouseOverLine(evt) { 
    var Label = document.getElementById(evt.target.id.replace("Line", "Label")); 
    evt.target.setAttribute("style", "fill:none;stroke:black;stroke-width:3"); 
    Label.setAttribute("font-size", 17); 
} 
function onMouseOutLine(evt) { 
    var Label = document.getElementById(evt.target.id.replace("Line", "Label")); 
    evt.target.setAttribute("style", "fill:none;stroke:black;stroke-width:1"); 
    Label.setAttribute("font-size", 15); 
}
